text:
{'text': "Located near Woodlands Checkpoint, the world's busiest land border crossing, this whitewashed-blue mosque stands out as the nation's mosque with the tallest minaret and is informally known as the 'Blue Mosque of Singapore'. Its strategic location at the tip of Singapore's northern borders with Johor signifies the closest landmark for travellers to identify.

Accommodating 6,000 worshippers at any time, An-Nur Mosque was constructed in 1964 to serve the Woodlands kampongs at that time. Costing around SGD2.1 million in 1964 currency value, this mosque was Her Majesty in her rights. Today, she serves as a community centre and youth hub where the mosque connects with people from all walks of life earning her the title, 'Community and Youth-Friendly Mosque 2009' by MUIS Singapore.

Bus services 178, 856 and 903 all serve this mosque along Admiralty Road. Most buses are from Woodlands, Yishun and Boon Lay.", 'languageCode': 'en'}

